import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import { Form, Button } from 'react-bootstrap';

const API_URL = 'http://localhost:5000';

const UpdateForm = ({ recordId, onCancel }) => {
  const [formData, setFormData] = useState({
    name: '',
    description: '',
    image_url: '',
    price: '',
    category: '',
    stock: 0,
  });

  const fetchRecordData = useCallback(async () => {
    try {
      const res = await axios.get(`${API_URL}/api/equipment/${recordId}`);
      const d = res.data;

      setFormData({
        name: d.name ?? '',
        description: d.description ?? '',
        image_url: d.image_url ?? '',
        price: d.price ?? '',
        category: d.category ?? '',
        stock: d.stock ?? 0,
      });
    } catch (e) {
      console.log('Ошибка загрузки данных', e);
    }
  }, [recordId]);

  useEffect(() => {
    if (recordId) fetchRecordData();
  }, [fetchRecordData, recordId]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;

    setFormData((prev) => ({
      ...prev,
      [name]: name === 'stock' ? Number(value) : value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      await axios.put(`${API_URL}/api/equipment/${recordId}`, formData);
      alert('Снаряжение успешно обновлено');
      onCancel();
    } catch (e) {
      console.log('Ошибка обновления', e);
    }
  };

  return (
    <div className="update-form-container">
      <h2>Изменить снаряжение</h2>

      <Form onSubmit={handleSubmit} className="update-form">
        <Form.Group>
          <Form.Label>Название</Form.Label>
          <Form.Control name="name" value={formData.name} onChange={handleInputChange} />
        </Form.Group>

        <Form.Group>
          <Form.Label>Описание</Form.Label>
          <Form.Control name="description" value={formData.description} onChange={handleInputChange} />
        </Form.Group>

        <Form.Group>
          <Form.Label>Ссылка на фото (image_url)</Form.Label>
          <Form.Control name="image_url" value={formData.image_url} onChange={handleInputChange} />
        </Form.Group>

        <Form.Group>
          <Form.Label>Цена</Form.Label>
          <Form.Control type="number" name="price" value={formData.price} onChange={handleInputChange} />
        </Form.Group>

        <Form.Group>
          <Form.Label>Категория</Form.Label>
          <Form.Control name="category" value={formData.category} onChange={handleInputChange} />
        </Form.Group>

        <Form.Group>
          <Form.Label>В наличии (stock)</Form.Label>
          <Form.Control type="number" name="stock" value={formData.stock} onChange={handleInputChange} />
        </Form.Group>

        <Button type="submit" className="btn btn-primary">Сохранить</Button>{' '}
        <Button variant="secondary" onClick={onCancel}>Отмена</Button>
      </Form>
    </div>
  );
};

export default UpdateForm;
